import React from 'react';
import {observer} from 'mobx-react';
import store from './store';

const {tasks} = store

function App() {
  return (
    <div className="App">
      {
        tasks.map(task=>(
          <h1>{task.id}</h1>
        ))
      }
      <button>HH</button>
    </div>
  );
}

export default observer(App);
